description.text:
From Nikoss'Toys
1st of the series Nikoss'Creatures : &quot;Nikoss'Unicorn&quot;
(Version for FDM)

This is a mod for this two pieces. For me, using four screws or 3 screws for each diagonal rods make the effector very heavy.
This new will use only two screws for alternative traxxas (each one).
This is tested and use M3 Screws with 20mm (not tested with 15mm).
I'm using nylon nuts for lock better. After the new delta is finish, I will upload some pictures. 
The OpenScad (the reference was added as a mod):
//V3.2 of Nathan Stenzel's rod ends for sturdy stakes and the Rostock Max U-joint
intersection(){<br />
difference(){<br />
//the starting material of the prongs<br />
translate([0,0,17.5])cube(size=[18,8,22], center=true);<br />
//minus some material<br />
union(){<br />
//the axle hole<br />
translate([-10,0,24])rotate([90,0,90])cylinder(h=20, d=2.95, $fn=20);<br />
//the gap between the prongs<br />
translate([0,0,22])cube(size=[8.1,10,20], center=true);<br />
//the rounded part in the gap between the prongs<br />
translate([0,10,12])rotate([90,0,0])cylinder(h=20, d=8.25);<br />
}<br />
}<br />
//trim some off the corners of the prongs<br />
translate([0,0,15])sphere(r=15);<br />
//trim some off the bottom and top of the prongs<br />
translate([0,0,5])rotate([0,0,90])cylinder(h=26,r1=8, r2=8);
}
//shaft<br />
translate([0,0,-13])cylinder(h=20, r=3.2, $fn=6 );<br />
//the narrower part of the shaft<br />
translate([0,0,-10])cylinder(h=2, r2=1.90, r1=1.5, $fn=15);
